/*==================================================
NewCampusView.js

The Views component is responsible for rendering web page with data provided by the corresponding Container component.
It constructs a React component to display a form to add a new campus.
================================================== */
import React, { useState } from 'react'; 
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';
import './styles/NewCampusView.css';

const NewCampusView = (props) => {
  // ... your existing state and functions remain the same ...

  return (
    <div className="new-campus-container">
      <div className="form-header">
        <div className="title-section">
          <h1>Add New Campus</h1>
          <p className="subtitle">Enter campus information below</p>
        </div>
      </div>

      <div className="form-card">
        <form onSubmit={handleSubmit} className="new-campus-form">
          <div className="form-grid">
            <div className="form-group">
              <label htmlFor="name">
                Campus Name<span className="required">*</span>
              </label>
              <input
                type="text"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                className={errors.name ? 'error' : ''}
                placeholder="Enter campus name"
                required
              />
              {errors.name && <span className="error-message">⚠️ {errors.name}</span>}
            </div>

            <div className="form-group">
              <label htmlFor="address">
                Address<span className="required">*</span>
              </label>
              <input
                type="text"
                id="address"
                name="address"
                value={formData.address}
                onChange={handleChange}
                className={errors.address ? 'error' : ''}
                placeholder="Enter campus address"
                required
              />
              {errors.address && <span className="error-message">⚠️ {errors.address}</span>}
            </div>

            <div className="form-group">
              <label htmlFor="imageUrl">Image URL</label>
              <input
                type="text"
                id="imageUrl"
                name="imageUrl"
                value={formData.imageUrl}
                onChange={handleChange}
                className={errors.imageUrl ? 'error' : ''}
                placeholder="https://example.com/image.jpg"
              />
              {errors.imageUrl && <span className="error-message">⚠️ {errors.imageUrl}</span>}
            </div>

            <div className="form-group">
              <label htmlFor="description">Description</label>
              <textarea
                id="description"
                name="description"
                value={formData.description}
                onChange={handleChange}
                rows="4"
                placeholder="Enter campus description"
                className={errors.description ? 'error' : ''}
              />
              {errors.description && <span className="error-message">⚠️ {errors.description}</span>}
            </div>
          </div>

          <div className="form-actions">
            <button 
              type="submit"
              className="submit-button"
              disabled={Object.values(errors).some(error => error !== '')}
            >
              Add Campus
            </button>
          </div>
        </form>
      </div>

      <div className="back-button-container">
        <Link to="/campuses" className="back-button">
          ← Back to Campuses
        </Link>
      </div>
    </div>
  );
};

NewCampusView.propTypes = {
  handleSubmit: PropTypes.func.isRequired
};

export default NewCampusView;
